import React, { useEffect, useState } from "react";
import { useForm } from "react-hook-form";
import { useDispatch, useSelector } from "react-redux";
import axios from "axios";
import {
  loginStart,
  loginSuccess,
  loginFailure,
} from "../../Redux/slices/authSlice";
import { fetchCart } from "../../Redux/slices/cartSlice";
import { fetchWishlist } from "../../Redux/slices/wishListSlice";
import { setCurrentUser, getCurrentUser } from "../../lib/storage";
import { useNavigate, useLocation, Link } from "react-router-dom";
import ToastNotification from "../../Components/shared/ToastNotification";
import {
  HiCheck,
  HiX,
  HiEye,
  HiEyeOff,
  HiMail,
  HiLockClosed,
  HiArrowRight,
  HiShieldCheck,
} from "react-icons/hi";
import { FaLeaf } from "react-icons/fa";

export default function Login() {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const location = useLocation();
  const { loading } = useSelector((state) => state.auth);

  // Component state
  const [showPassword, setShowPassword] = useState(false);
  const [isAnimating, setIsAnimating] = useState(false);
  const [toast, setToast] = useState({ show: false, message: "", type: "" });

  const showToastMessage = (message, type = "success") => {
    setToast({ show: true, message, type });
    setTimeout(() => setToast({ show: false, message: "", type: "" }), 4000);
  };

  const {
    register,
    handleSubmit,
    formState: { errors, isValid, touchedFields, isSubmitted },
    watch,
  } = useForm({ mode: "onChange", reValidateMode: "onChange" });

  const watchedFields = watch();

  useEffect(() => {
    try {
      const savedUser = getCurrentUser();
      if (savedUser && location.pathname !== "/login") {
        dispatch(loginSuccess(savedUser));
        // Fetch cart and wishlist data for existing logged-in user
        dispatch(fetchCart());
        dispatch(fetchWishlist());
        navigate("/");
      }
    } catch {
      // ignore
    }
  }, [dispatch, navigate, location.pathname]);

  const onSubmit = async (data) => {
    if (loading) return;

    try {
      setIsAnimating(true);
      dispatch(loginStart());

      // Concurrent API calls for better performance
      const [usersRes, adminsRes, vendorsRes] = await Promise.all([
        axios.get("https://nutrifast-data.up.railway.app/users"),
        axios.get("https://nutrifast-data.up.railway.app/admins"),
        axios.get("https://nutrifast-data.up.railway.app/vendors"),
      ]);

      const allUsers = [
        ...usersRes.data,
        ...adminsRes.data,
        ...vendorsRes.data,
      ];
      const user = allUsers.find(
        (u) => u.email === data.email && u.password === data.password
      );

      if (!user) {
        showToastMessage("Invalid email or password", "error");
        dispatch(loginFailure("Invalid email or password"));
        setIsAnimating(false);
        return;
      }

      setCurrentUser(user);
      dispatch(loginSuccess(user));

      // Immediately fetch cart and wishlist data after successful login
      dispatch(fetchCart());
      dispatch(fetchWishlist());

      showToastMessage("Welcome back! Login successful", "success");

      setTimeout(() => {
        setIsAnimating(false);
        navigate("/");
      }, 1500);
    } catch (err) {
      setIsAnimating(false);
      dispatch(loginFailure(err.message || "Login failed"));
      showToastMessage("Something went wrong. Please try again.", "error");
    }
  };

  return (
    <div
      className='min-h-screen -mt-16 pt-16 flex items-center justify-center p-4 relative overflow-hidden'
      style={{
        backgroundImage: `url('data:image/jpeg;base64,')`,
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
      }}>
      {/* Toast Notification */}
      {/* Toast Notification */}
      <ToastNotification
        show={toast.show}
        message={toast.message}
        type={toast.type}
        onClose={() => setToast({ show: false, message: "", type: "" })}
      />
      {/* Main Login Container */}
      <div className='w-full max-w-lg relative z-10'>
        {/* Enhanced Card with Modern Design */}
        <div className='bg-white/80 backdrop-blur-md rounded-3xl shadow-2xl border border-white/20 overflow-hidden relative'>
          <div className='p-6 md:p-8 relative z-10'>
            {/* Header Section (icon removed) */}
            <div className='text-center mb-6'>
              <div className='space-y-2'>
                <h2 className='text-2xl sm:text-3xl md:text-4xl text-center font-bold text-app-secondary tracking-tight mb-2'>
                  Welcome Back
                </h2>
                <p className='text-base text-gray-600 font-medium'>
                  Sign in to continue your healthy journey
                </p>
              </div>
            </div>

            {/* Enhanced Login Form */}
            <form onSubmit={handleSubmit(onSubmit)} className='space-y-3'>
              {/* Email Field */}
              <div className='space-y-1'>
                <div className='relative group'>
                  <input
                    id='email'
                    type='email'
                    placeholder='Enter your email address'
                    {...register("email", {
                      required: "Email is required",
                      pattern: {
                        value: /^[^\s@]+@[^\s@]+\.[^\s@]+$/,
                        message: "Please enter a valid email address",
                      },
                    })}
                    className={`w-full px-4 py-3 pl-12 bg-gray-50 border-2 rounded-2xl 
                      transition-all duration-300 focus:outline-none focus:ring-0 text-base font-medium
                      group-hover:bg-gray-100/50
                      ${
                        errors.email
                          ? "border-red-300 focus:border-red-400 bg-red-50/50"
                          : watchedFields.email && !errors.email
                          ? "border-app-secondary focus:border-app-primary bg-green-50/30"
                          : "border-gray-200 focus:border-app-primary hover:border-gray-300"
                      }
                      placeholder-gray-400 text-app-tertiary`}
                  />
                  <HiMail className='absolute left-4 top-1/2 transform -translate-y-1/2 text-gray-400 text-lg group-focus-within:text-app-primary transition-colors' />

                  {/* Validation Indicator (show only after touched or submit) */}
                  {(touchedFields.email || isSubmitted) && !errors.email && (
                    <div className='absolute right-4 top-1/2 transform -translate-y-1/2'>
                      <div className='w-6 h-6 bg-app-secondary rounded-full flex items-center justify-center'>
                        <HiCheck className='text-white text-sm' />
                      </div>
                    </div>
                  )}
                </div>
                <div className='min-h-[1rem]'>
                  <p
                    role='alert'
                    aria-live='polite'
                    aria-hidden={
                      !((touchedFields.email || isSubmitted) && errors.email)
                    }
                    className={`text-red-500 text-sm flex items-center gap-1 font-medium transition-opacity duration-150 ${
                      (touchedFields.email || isSubmitted) && errors.email
                        ? "opacity-100 visible"
                        : "opacity-0 invisible"
                    }`}>
                    <HiX className='text-xs flex-shrink-0' />
                    <span className='leading-tight'>
                      {errors.email?.message}
                    </span>
                  </p>
                </div>
              </div>

              {/* Password Field */}
              <div className='space-y-1'>
                <div className='relative group'>
                  <input
                    id='password'
                    type={showPassword ? "text" : "password"}
                    placeholder='Enter your password'
                    {...register("password", {
                      required: "Password is required",
                      minLength: {
                        value: 6,
                        message: "Password must be at least 6 characters",
                      },
                    })}
                    className={`w-full px-4 py-3 pl-12 pr-12 bg-gray-50 border-2 rounded-2xl 
                      transition-all duration-300 focus:outline-none focus:ring-0 text-base font-medium
                      group-hover:bg-gray-100/50
                      ${
                        errors.password
                          ? "border-red-300 focus:border-red-400 bg-red-50/50"
                          : watchedFields.password && !errors.password
                          ? "border-app-secondary focus:border-app-primary bg-green-50/30"
                          : "border-gray-200 focus:border-app-primary hover:border-gray-300"
                      }
                      placeholder-gray-400 text-app-tertiary`}
                  />
                  <HiLockClosed className='absolute left-4 top-1/2 transform -translate-y-1/2 text-gray-400 text-lg group-focus-within:text-app-primary transition-colors' />

                  <button
                    type='button'
                    onClick={() => setShowPassword(!showPassword)}
                    className='absolute right-4 top-1/2 transform -translate-y-1/2 text-gray-400 hover:text-app-primary transition-colors p-1 rounded-lg hover:bg-gray-100'>
                    {showPassword ? (
                      <HiEyeOff className='text-lg' />
                    ) : (
                      <HiEye className='text-lg' />
                    )}
                  </button>
                </div>
                <div className='min-h-[1rem]'>
                  <p
                    role='alert'
                    aria-live='polite'
                    aria-hidden={
                      !(
                        (touchedFields.password || isSubmitted) &&
                        errors.password
                      )
                    }
                    className={`text-red-500 text-sm flex items-center gap-1 font-medium transition-opacity duration-150 ${
                      (touchedFields.password || isSubmitted) && errors.password
                        ? "opacity-100 visible"
                        : "opacity-0 invisible"
                    }`}>
                    <HiX className='text-xs flex-shrink-0' />
                    <span className='leading-tight'>
                      {errors.password?.message}
                    </span>
                  </p>
                </div>
              </div>

              {/* Remember Me & Forgot Password */}
              <div className='flex items-center justify-between pt-2'>
                <Link
                  to='/forgot-password'
                  className='text-app-primary hover:text-app-tertiary transition-colors font-bold text-sm hover:underline'>
                  Forgot Password?
                </Link>
              </div>

              {/* Submit Button */}
              <button
                type='submit'
                disabled={loading || isAnimating || !isValid}
                className={`w-full py-3 px-5 rounded-2xl font-semibold text-base text-white transition-all duration-300 
                  flex items-center justify-center gap-3 shadow-lg relative overflow-hidden group
                  ${
                    loading || isAnimating || !isValid
                      ? "bg-gray-400 cursor-not-allowed opacity-60 transform-none"
                      : "bg-app-primary hover:bg-app-secondary shadow-app-primary/30 hover:shadow-xl hover:shadow-app-secondary/40 transform hover:-translate-y-1 active:translate-y-0"
                  }`}>
                {/* Button Background Animation */}
                <div
                  className={`absolute inset-0 bg-app-secondary opacity-0 group-hover:opacity-100 transition-opacity duration-300 ${
                    loading || isAnimating || !isValid ? "hidden" : ""
                  }`}></div>

                <div className='relative z-10 flex items-center gap-3'>
                  {loading || isAnimating ? (
                    <>
                      <div className='w-6 h-6 border-2 border-white border-t-transparent rounded-full animate-spin'></div>
                      Signing In...
                    </>
                  ) : (
                    <>
                      <HiShieldCheck className='text-xl' />
                      Sign In to Continue
                      <HiArrowRight className='text-xl group-hover:translate-x-1 transition-transform' />
                    </>
                  )}
                </div>
              </button>

              {/* Enhanced Sign Up Link */}
              <div className='text-center bg-app-muted p-6 rounded-2xl border border-gray-100'>
                <p className='text-gray-600 text-base mb-3'>
                  Ready to start your healthy journey?
                </p>
                <Link
                  to='/choose-role'
                  className='inline-flex items-center gap-2 font-bold text-app-tertiary hover:text-app-primary transition-colors text-lg group'>
                  <span className='text-app-primary'>Create Your Account</span>
                  <HiArrowRight className='text-app-primary group-hover:translate-x-1 transition-transform' />
                </Link>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}
